// Tabs
jQuery(document).ready( function ($, window, undefined) {

	var $doc = $(document),
		$win = $(window),
		$html = $('html'),
		settings = {
			ariaChartsUrl: 'http://www.ariacharts.com.au/chart/api/singles',
			breakpoints: {
				xxsmall: 	[0, 399],
				xsmall:  	[400, 600],
				small:  	[601, 642],
				medium: 	[643, 1024],
				large: 		[1025, 9999]
			}
		},
		track = {
			chartColumn: 0,
			winW: $win.innerWidth(),
			breakpoint: ''
		},
		$menu = $('#mobile-menu-stick'),
		$chart = $('#chart'),
		$chartSlider = $('#chart-slider'),
		chartData = [],
		raf = window.requestAnimationFrame;

	// Foundation
	$doc.foundation();

	// Chart carousel
	$chartSlider.slick({
		dots: false,
		infinite: false,
		arrows: false,
		slidesToShow: 2,
		slidesToScroll: 2,
		infinite: false,
		responsive: [
		// Tablet Portrait
		{
			breakpoint: settings.breakpoints.medium[1]+1,
			settings: {
				slidesToShow: 1,
				slidesToScroll: 1,
				infinite: false
			}
		},
		// Phone Landscape
		{
			breakpoint: settings.breakpoints.small[1],
			settings: {
				slidesToShow: 2,
				slidesToScroll: 2,
				infinite: false
			}
		},
		// Phone Portrait
		{
			breakpoint: settings.breakpoints.xsmall[1],
			settings: {
				slidesToShow: 1,
				slidesToScroll: 1,
				infinite: false
			}
		}]
	});

	// Events
	$doc
		// Navigate to next chart slide
		.on('click', '[href="#chart-next"]', function (event) {
			event.preventDefault();
			$chartSlider.slick('slickNext');
		})
		// Navigate to previous chart slide
		.on('click', '[href="#chart-back"]', function (event) {
			event.preventDefault();
			$chartSlider.slick('slickPrev');
		})
		// Show mobile menu
		.on('click', '.mobile-menu-toggle', function (event) {
			event.preventDefault();

			$html.toggleClass('ui-show-mobile-menu');
		})
		// Click any other hash anchor links
		.on('click', '[href^=#]', function (event) {
			event.stopPropagation();
			var href = $(this).attr('href');
			if ( href !== '#' && !/^#((listen|chart)-)/i.test(href) ) {
				event.preventDefault();
				scrollTo(href);
			}
		})
		// Click any link dismisses the mobile menu
		.on('click', '.mobile-menu a', function (event) {
			$html.removeClass('ui-show-mobile-menu');
		})
		// Slick.afterChange
		.on('afterChange', '#chart-slider', function(event, slick, currentSlide) {
			track.currentChartColumn = currentSlide;
			$chart.attr('data-chart-column', currentSlide);
		});

	// Window events
	$win
		.on('resize orientationchange', function () {
			requestAnimationFrame( updateWin );
		});

	// JS breakpoints
	function updateWin() {
		track.winW = $win.innerWidth();

		for ( var i in settings.breakpoints ) {
			var bp = settings.breakpoints[i];
			if ( track.winW >= bp[0] && track.winW <= bp[1] ) {
				$html.removeClass('ui-breakpoint-xxsmall ui-breakpoint-xsmall ui-breakpoint-small ui-breakpoint-medium ui-breakpoint-large').addClass('ui-breakpoint-'+i);
				track.breakpoint = i;
				break;
			}
		}
	}

	// Scroll to position on page
	function scrollTo( target ) {
		var targetPos = 0, $target;
		
		// Get the value to scroll to
		switch (typeof target) {
			case 'number':
				targetPos = target;
				break;

			case 'object':
			case 'string':
			default:
				$target = $(target);
				if ( $target.length > 0 )
					targetPos = $target.offset().top;
				break;
		}

		// Hide the off canvas menu
		$html.removeClass('ui-show-mobile-menu');

		// Animate the page scroll
		$("html, body").animate({
	    	scrollTop: targetPos
	    }, {
			duration: 400,
			easing: "swing"
	    });

	    return false;
	}

	// Get the ARIA Charts data
	function getChartData() {
		$chart.addClass('ui-loading');

		// Fetch JSON data of the latest chart
		$.ajax({
			method: 'get',
			url: settings.ariaChartsUrl,
			success: function ( data, textStatus, xhr ) {
				var $ariaChartItems = $(data).find('#main .chart-box .item');
				chartData = data[0];
				// console.log(chartData);
				renderChartData(chartData);
			},
			error: function ( xhr, textStatus, err ) {
				// console.log( err, textStatus, xhr );
				$chart.removeClass('ui-loading').addClass('ui-error');
			}
		});
	}

	// Render the chart data
	function renderChartData( chartData ) {
		var chartTracks = [];

		for ( var i=0; i<chartData.tracks.length; i++ ) {
			var track = chartData.tracks[i],
				rank = track.rank < 10 ? '0'+track.rank : track.rank,
				artwork = track.artwork === '' ? '' : '<img src="'+track.artwork+'" alt="" title="&quot;'+track.name+'&quot; by '+track.artist+'"/>',
				chartTrack;

			chartTrack = '<div class="chart-item">\
				<div class="chart-item-rank">'+rank+'</div>\
				<div class="chart-item-artwork">'+artwork+'</div>\
				<div class="chart-item-info">\
					<div class="chart-item-title">'+track.name+'</div>\
					<div class="chart-item-artist">'+track.artist+'</div>\
				</div>\
			</div>';

			chartTracks.push(chartTrack);
		}

		// Populate the chart columns
		for ( var i=10; i<=40; i+=10 ) {
			var $chartColumn = $('#chart-'+i),
				chartColumnTracks = '';

			chartColumnTracks = chartTracks.splice(0, 10).join('');
			$chartColumn.html(chartColumnTracks);
		}

		$chart.removeClass('ui-loading ui-error');
		$chartSlider.slick('setPosition');
	}

	getChartData();
	updateWin();
 
}(jQuery, window));